import React from "react";
import Card from "./Card";
import Sdata from "./Sdata";

function myCard(val){
    return(
        <Card 
        imgsrc = {Sdata[0].imgsrc}
        catagory = {Sdata[0].catagory}
        title = {Sdata[0].title}
        link = {Sdata[0].link}
      />
    )
}

function App(){
    return(
        <>
    <h1 className="heading"> Top 5 Netflix List </h1>
        
    </>
    );
};
export default App;
